INSERT INTO `creature_text` (`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `comment`) VALUES
(127479, 0, 0, '|TInterface\\Icons\\SPELL_NATURE_EARTHQUAKE:20|t%s targets |cFFFF0000$n|r with |cFFFF0000|Hspell:257617|h[Upheaval]|h|r! Spread out!', 41, 0, 100, 0, 0, 0, 0, 'The Sand Queen to Player'),
(127484, 0, 0, 'Fresh meat!', 14, 0, 100, 0, 0, 98150, 1393, 'Jes Howlis'), -- BroadcastTextID: 1393 - 24871 - 61212 - 61619 - 77509 - 91097
(127484, 1, 0, '|TInterface\\Icons\\ABILITY_ROGUE_FANOFKNIVES:20|t%s is preparing to throw |cFFFF0000|Hspell:257785|h[Flashing Daggers]|h|r! Hide!', 41, 0, 100, 0, 0, 98160, 0, 'Jes Howlis'),
(127484, 2, 0, 'This shiv is going right through your ribcage!', 14, 0, 100, 0, 0, 98160, 24871, 'Jes Howlis'),
(127484, 3, 0, 'Come on, boys! Show them why this is our block!', 14, 0, 100, 0, 0, 98156, 61212, 'Jes Howlis'),
(127484, 4, 0, 'On your feet, little brother! There\'s killing to be done.', 14, 0, 100, 0, 0, 98157, 61619, 'Jes Howlis'),
(127484, 5, 0, 'I\'ve been sharpening these blades just for you.', 14, 0, 100, 0, 0, 98155, 77509, 'Jes Howlis'),
(127484, 6, 0, 'But I was... up for... parole...', 14, 0, 100, 0, 0, 98154, 91097, 'Jes Howlis to Player'),
(127485, 0, 0, 'No fair, you got the last one!', 12, 0, 100, 0, 0, 0, 0, 'Bilge Rat Looter'),
(127485, 1, 0, 'Search his pockets!', 12, 0, 100, 35, 0, 0, 0, 'Bilge Rat Looter'),
(127485, 2, 0, 'Grab the keys!', 12, 0, 100, 35, 0, 0, 0, 'Bilge Rat Looter'),
(127485, 3, 0, 'Hey, that\'s mine!', 12, 0, 100, 35, 0, 0, 0, 'Bilge Rat Looter'),
(127485, 4, 0, '%s attempts to run away in fear!', 16, 0, 100, 35, 0, 0, 1150, 'Bilge Rat Looter'),
(127490, 0, 0, 'It\'s time to turn up the heat!', 14, 0, 100, 0, 0, 98134, 0, 'Knight Captain Valyri'),
(127490, 1, 0, '|TInterface\\Icons\\SPELL_MAGE_FLAMEORB:20|tQuickly move Munitions Barrels out of fires to prevent %s from exploding them!', 41, 0, 100, 0, 0, 0, 0, 'Knight Captain Valyri'),
(127490, 2, 0, 'I\'ll reduce you to cinders!', 14, 0, 100, 0, 0, 98136, 0, 'Knight Captain Valyri to Munitions Barrel'),
(127490, 3, 0, 'More fuel for the flames! Now!', 14, 0, 100, 0, 0, 98137, 0, 'Knight Captain Valyri to Explosive Munitions'),
(127490, 4, 0, 'I want these fires burning hotter!', 14, 0, 100, 0, 0, 98138, 0, 'Knight Captain Valyri to Invisible Stalker (Scale x0.5)'),
(127490, 5, 0, 'The brightest stars... burn out... the fastest.', 14, 0, 100, 0, 0, 98138, 0, 'Knight Captain Valyri to Player'),
(127503, 0, 0, 'So kind of you to return for your executions.', 14, 0, 100, 0, 0, 98171, 0, 'Overseer Korgus'),
(127503, 1, 0, 'I\'ve been eager to try these rounds on living targets.', 14, 0, 100, 0, 0, 98175, 0, 'Overseer Korgus'),
(127503, 2, 0, 'You\'ll get caught in the crossfire!', 14, 0, 100, 0, 0, 98176, 0, 'Overseer Korgus'),
(127503, 3, 0, 'Run all you want! I never miss.', 14, 0, 100, 0, 0, 98177, 0, 'Overseer Korgus'),
(127503, 4, 0, 'Your sentence is death!', 14, 0, 100, 0, 0, 98172, 0, 'Overseer Korgus to Player'),
(127503, 5, 0, 'Good... shot...', 14, 0, 100, 0, 0, 98178, 0, 'Overseer Korgus to Player'),
(130025, 0, 0, 'Intruders are coming through the sewers!', 14, 0, 100, 0, 0, 0, 0, 'Irontide Thug to Player'),
(130655, 0, 0, 'No! I\'ll never go back to that cell! NEVER!', 14, 0, 100, 0, 0, 98149, 0, 'Bobby Howlis to Player'),
(131856, 0, 0, 'More bombs incoming!', 14, 0, 100, 0, 0, 98146, 0, 'Ashvane Quartermaster'),
(131856, 1, 0, 'Yes, ma\'am!', 14, 0, 100, 0, 0, 98145, 118627, 'Ashvane Quartermaster'),
(133605, 0, 0, 'I did it, I made it out!', 12, 0, 100, 0, 0, 0, 0, 'Escaped Convict to Player'),
(133605, 1, 0, 'AAAHHHHHH!', 14, 0, 100, 0, 0, 0, 78144, 'Escaped Convict to Player'),
(135254, 0, 0, 'Those boots will look good on me.', 12, 0, 100, 0, 0, 0, 0, 'Irontide Raider'),
(135624, 0, 0, 'Let me out!', 12, 0, 100, 0, 0, 0, 41816, 'Alliance Hostage'),
(135629, 0, 0, 'Don\'t leave me here!', 12, 0, 100, 0, 0, 0, 0, 'Alliance Hostage'),
(135699, 0, 0, 'The beast is dead! Ashvane, secure the upper floors! I\'ll take care of this thief...', 14, 0, 100, 0, 0, 0, 0, 'Ashvane Jailer to Player'),
(135706, 0, 0, 'You\'ll never take me alive!', 14, 0, 100, 0, 0, 0, 0, 'Bilge Rat Looter to Ashvane Jailer'), -- BroadcastTextID: 40530 - 101728
(136665, 0, 0, 'They\'re here! Light the munitions!', 14, 0, 100, 0, 0, 0, 0, 'Ashvane Spotter'),
(136692, 0, 0, 'That creature must be why the Overseer didn\'t have many patrols on this side of the island. Good job defeating it.', 12, 0, 100, 0, 0, 98185, 0, 'Taelia to Player'),
(136692, 1, 0, 'Oof! You had to crawl through this stuff to escape? Try to stay downwind from me!', 12, 0, 100, 0, 0, 98186, 0, 'Taelia to Player');
